class Solution:
     def compareVersion(self, version1, version2):
         """
         :type version1: str
         :type version2: str
         :rtype: int
         """
         v1 = version1.split('.')
         v2 = version2.split('.')
         for i in range(max(len(v1), len(v2))):
             try:
                 v1[i] = int(v1[i])
             except:
                 v1[i] = 0
             try:
                 v2[i] = int(v2[i])
             except:
                 v2[i] = 0
         for i in range(len(v1)):
             if v1[i] > v2[i]:
                 return 1
             elif v1[i] < v2[i]:
                 return -1
         return 0

