from collections import deque
from itertools import product

def solve(start, end, word_set):
    queue = deque([(start, 0)])
    seen = set([start])
    while queue:
        word, steps = queue.popleft()
        if word == end:
            return word, steps
        for i, c in enumerate(word):
            for n in product('ABCDEFGHIJKLMNOPQRSTUVWXYZ', repeat=8):
                n = ''.join(n)
                if n not in word_set:
                    continue
                if len(n) > 1 and n[0] == c:
                    continue
                if n not in seen:
                    seen.add(n)
                    queue.append((n, steps + 1))
    return None, None

def main():
    n = int(input())
    word_set = set()
    for _ in range(n):
        word = input()
        word_set.add(word)
    start, end = input().split()
    start_len = len(start)
    end_len = len(end)
    if start_len != end_len:
        return 0, 0
    result, steps = solve(start, end, word_set)
    if result is None:
        return 0, -1
    return result, steps

